    /**
    /**
     * {@inheritDoc}
     */
    public function load(ObjectManager $manager)
    {
        foreach ($this->getAppointments() as $a) {
            $appointment = new Appointment();
            foreach($a as $method => $value) {
                if ($method === 'setDatetime') {
                    $appointment->setDatetime(\DateTime::createFromFormat('Y-m-d', $value));
                } elseif ($method === 'setDuration') {
                    $appointment->setDuration(new \DateTime('1900-01-01 02:30:00'));
                } else {
                    $appointment->$method($value);
                }
            }
            $customer = $this->getRandomCustomer();
            $appointment
                ->setOffice($customer->getOffice())
                ->setCustomer($customer)
                ->setSalesRep($this->getRandomStaff($customer->getOffice()->getId()))
                ->setAddressStreet($customer->getAddressStreet())
                ->setAddressCity($customer->getAddressCity())
                ->setAddressState($customer->getAddressState())
                ->setAddressZip($customer->getAddressZip())
                ->setAddressLat($customer->getAddressLat())
                ->setAddressLng($customer->getAddressLng());
            ;

            switch ($appointment->getProductInterest()) {
                case 'windows':
                    $appointment->setRoofAge(null)
                        ->setSidesQty(null);
                    break;

                case 'roofing':
                    $appointment->setWindowsQty(null)
                        ->setWindowsQty(null)
                        ->setSidesQty(null);
                    break;

                case 'siding':
                    $appointment->setWindowsQty(null)
                        ->setWindowsQty(null)
                        ->setRoofAge(null);
                    break;
            }

            switch ($appointment->getStatus()) {
                case 'canceled':
                    $appointment->setCanceled(1);
                    break;

                case 'sold':
                    $appointment->setCancelReason(null);
                    $appointment->setLost(0);
                    break;

                default:
                    $appointment->setCancelReason(null);
                    break;
            }

            $manager->persist($appointment);
            $manager->flush();
            if ($appointment->getStatus() === 'sold') {
                $this->addReference('appointment' . (string) $appointment->getId(), $appointment);
            }
        }
    }

